/* Partial NTT (naive O(n^2) method with Hornor's rule) */
static void ntt_core(uint32_t *a, uint32_t N1, uint32_t N2, uint32_t DIM, const uint32_t *omega_n)
{
	uint32_t DIM_NTT = N1 * N2;
	uint32_t b[N + D + K + 1];
	int i, j;
	
	b[0] = 0;
	for (i = DIM - 1; i >= 0; i--)
	{
		b[0] = (b[0] + a[i]) % Q;
	}
	
	for (i = 1; i < DIM_NTT; i++)
	{
		b[i] = 0;
		/* Hornor's rule */
		for (j = DIM - 1; j >= 0; j--)
		{
			b[i] = (((uint64_t)b[i] * (uint64_t)omega_n[i]) % Q) + a[j];
		}
		b[i] %= Q;
	}
	
	/* change the order to match the optimized NTT */
	for (i = 0; i < DIM_NTT; i++)
	{
		a[i] = b[(i % N2) * N1 + i / N2];
	}
}

/* Partial INTT (naive O(n^2) method with Hornor's rule) */
static void intt_core(uint32_t *a, uint32_t N1, uint32_t N2, uint32_t DIM, const uint32_t *omega_n, uint32_t inv_n)
{
	uint32_t DIM_NTT = N1 * N2;
	uint32_t b[N + D + K + 1];
	int i, j;
	
	/* change the order to match the optimized NTT */
	for (i = 0; i < DIM_NTT; i++)
	{
		b[i] = a[(i % N1) * N2 + i / N1];
	}
	
	a[0] = 0;
	for (i = DIM_NTT - 1; i >= 0; i--)
	{
		a[0] = (a[0] + b[i]) % Q;
	}
	a[0] = ((uint64_t)a[0] * (uint64_t)inv_n) % Q;
	
	for (i = 1; i < DIM; i++)
	{
		a[i] = 0;
		/* Hornor's rule */
		for (j = DIM_NTT - 1; j >= 0; j--)
		{
			a[i] = (((uint64_t)a[i] * (uint64_t)omega_n[i]) % Q) + b[j];
		}
		a[i] = ((uint64_t)a[i] * (uint64_t)inv_n) % Q;
	}	
}

void intt_1792_1792(uint32_t *a)
{
	intt_core(a, N1_1792, N2_1792, 1792, omega_1792, INV_1792);
}

void intt_768_768(uint32_t *a)
{
	intt_core(a, N1_768, N2_768, 768, omega_768, INV_768);
}

void ntt_1536_1536(uint32_t *a)
{
	ntt_core(a, N1_1536, N2_1536, 1536, omega_1536);	
}

void intt_1536_1536_inv(uint32_t *a)
{
	intt_core(a, N1_1536, N2_1536, 1536, omega_1536_inv, INV_1536);
}

void ntt_768_768_inv(uint32_t *a)
{
	ntt_core(a, N1_768, N2_768, 768, omega_768_inv);
}
